import React, { useEffect, useState } from "react";
import axios from "axios";
import "./SupportDashboard.css";
import { useNavigate } from "react-router-dom";

const AdminDashboard = () => {
  const [tickets, setTickets] = useState([]);
  const [categories, setCategories] = useState([]);
  const [priorities, setPriorities] = useState([]);
  const [statuses, setStatuses] = useState([]);

  const [selectedCategory, setSelectedCategory] = useState("");
  const [selectedPriority, setSelectedPriority] = useState("");
  const [selectedStatus, setSelectedStatus] = useState("");

  const navigate = useNavigate();

  useEffect(() => {
    fetchTickets();
    fetchCategories();
    fetchPriorities();
    fetchStatuses();
  }, []);

  const fetchTickets = async () => {
    try {
      const token = localStorage.getItem("token");
      const res = await axios.get("http://localhost:5094/api/ticket/getAllTicketsByRole", {
        headers: { Authorization: `Bearer ${token}` },
      });
      setTickets(res.data);
    } catch (err) {
      console.error("Ticketlar alınamadı:", err);
      alert("Ticketlar yüklenirken bir hata oluştu.");
    }
  };

  const fetchCategories = async () => {
    try {
      const token = localStorage.getItem("token");
      const res = await axios.get("http://localhost:5094/api/category", {
        headers: { Authorization: `Bearer ${token}` },
      });
      setCategories(res.data);
    } catch (err) {
      console.error("Kategoriler alınamadı:", err);
    }
  };

  const fetchPriorities = async () => {
    try {
      const token = localStorage.getItem("token");
      const res = await axios.get("http://localhost:5094/api/priority", {
        headers: { Authorization: `Bearer ${token}` },
      });
      setPriorities(res.data);
    } catch (err) {
      console.error("Öncelikler alınamadı:", err);
    }
  };

  const fetchStatuses = async () => {
    try {
      const token = localStorage.getItem("token");
      const res = await axios.get("http://localhost:5094/api/status", {
        headers: { Authorization: `Bearer ${token}` },
      });
      setStatuses(res.data);
    } catch (err) {
      console.error("Durumlar alınamadı:", err);
    }
  };

  const filteredTickets = tickets.filter(ticket => {
    const matchCategory = selectedCategory ? ticket.category === selectedCategory : true;
    const matchPriority = selectedPriority ? ticket.priority === selectedPriority : true;
    const matchStatus = selectedStatus ? ticket.status === selectedStatus : true;
    return matchCategory && matchPriority && matchStatus;
  });

  return (
    <div className="support-container">
      <div className="sidebar">
        <div className="logo">HelpDesk</div>
        <ul className="nav">
          <li onClick={() => navigate("/ticket-list")} style={{ cursor: "pointer" }}>
            <span className="icon">🎫</span> <span className="label">Tickets</span>
          </li>
        </ul>
        <div className="profile">
          <img src="https://i.pravatar.cc/40" alt="admin" />
          <span>Admin</span>
        </div>
      </div>

      <div className="main-content">
        <div className="form-box">
          <h2 className="text-2xl font-bold mb-4">Filtreler</h2>
          <div className="ticket-detail-container">
            <div className="message-area">
              <label>Kategori</label>
              <select value={selectedCategory} onChange={(e) => setSelectedCategory(e.target.value)}>
                <option value="">Hepsi</option>
                {categories.map(cat => (
                  <option key={cat.categoryId} value={cat.categoryName}>
                    {cat.categoryName}
                  </option>
                ))}
              </select>
            </div>

            <div className="message-area">
              <label>Öncelik</label>
              <select value={selectedPriority} onChange={(e) => setSelectedPriority(e.target.value)}>
                <option value="">Hepsi</option>
                {priorities.map(p => (
                  <option key={p.priorityId} value={p.priorityName}>
                    {p.priorityName}
                  </option>
                ))}
              </select>
            </div>

            <div className="message-area">
              <label>Durum</label>
              <select value={selectedStatus} onChange={(e) => setSelectedStatus(e.target.value)}>
                <option value="">Hepsi</option>
                {statuses.map(s => (
                  <option key={s.statusId} value={s.statusName}>
                    {s.statusName}
                  </option>
                ))}
              </select>
            </div>
          </div>
        </div>

        <div className="form-box">
          <h2 className="text-2xl font-bold mb-2">Ticket Listesi</h2>
          <ul className="ticket-list">
            {filteredTickets.map(ticket => (
              <li key={ticket.id} onClick={() => navigate(`/ticket/${ticket.id}`)} style={{ cursor: "pointer" }}>
                <strong>{ticket.description}</strong><br />
                Kategori: {ticket.category} - Öncelik: {ticket.priority} - Durum: {ticket.status}
              </li>
            ))}
          </ul>
        </div>
      </div>
    </div>
  );
};

export default AdminDashboard;
